import React from 'react';

const ImageSlide = (props) => {
  const styles = {
    backgroundImage: `url('data:image/png;base64,')`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height:"300px",
    width:"500px",
   };

  return(
    <div className="image-slide" style={styles}></div>
  )
}

export default ImageSlide;
